# Check for commutativity
def check_commute(s1, s2):
    count = 0
    for i in range(len(s1)):
        p1, p2 = s1[i], s2[i]
        if p1 == 'I' or p2 == 'I':
            continue
        if p1 != p2:
            count += 1
    return count % 2 == 0

# Check all pairs
anticommuting = []
for i in range(len(stabilizers_raw)):
    for j in range(i+1, len(stabilizers_raw)):
        if not check_commute(stabilizers_raw[i], stabilizers_raw[j]):
            anticommuting.append((i, j))

print(f'Anticommuting pairs: {len(anticommuting)}')
if anticommuting:
    for pair in anticommuting[:5]:
        print(f'  Stabilizers {pair[0]} and {pair[1]} anticommute')
